    for additional information.   Per instructions from the FEC, the adjusting entry
    on line 21b balances the IE payments made to Senate Conservatives Fund for CC
    processing fees.   All disbursements disclosed on line 21b are operating expenses
    of the committee and are not public communications in support of or to oppose
    any other candidate.  All independent expenditures are disclosed on line 24. \n"
